import React from 'react';

// So you now we make an onClick event with first goal registering a console.log() 

class Dock extends React.Component {
    state = {
        dockBoolean: false
    }

    buttonClicked() {

    }

    DockClicked = () => {
        this.setState({ dockBoolean: !this.dockBoolean } )
        console.log(this.state.dockBoolean)
        let element = document.querySelector(".oea-title")
        element.style.display = "none"
        let content = document.querySelector(".oea-content")
        content.style.display = "inline"

    }
    render() {
    return (
        <div className="dock-panel-parent">
        <div className="dock-panel" onClick={this.DockClicked}>
            <div className="search-bar-parent">
                <img className="search-bar-png2" src="/SearchBar.png" alt="-" />
            </div>
            <div className="oea-title">
            <h4 className="oea-text">Omnibox Extension App</h4>
            </div>
            <div className="oea-content">
            <img className="back-button-svg" src="/back.svg"  alt="some" />
            <img className="forward-button-svg" src="/forward.svg" alt="some" />
            <img className="iris-svg" src="/iris.svg" alt="some" />
            <img className="left-blank" src="./sound.svg" alt="some" />
            <img onClick={ this.BalloonOn } className="balloon-wrench-svg" src={ this.state.balloonBoolean ? this.BalloonWrenchPicFilled : this.BalloonWrenchPic } alt="some" />
            <img className="previous-template-svg" src="./previous-template.png" alt="some" />

            </div>
            </div>











        <style jsx>{`
        .dock-panel-parent {
            display: flex;
            align-items: center;
            justify-content: center;
        }

        .dock-panel {
                width: 1507px;
                height: 76px;
                font-family: Montserrat;
                font-size: 23px;
                background-color: #000000;
                background-image: linear-gradient(0deg, #000000 0%, #414141 74%);
                position: relative;
                display: flex;
                align-items: center;
                justify-content: center;
                top: 177px;
                color: #2FA4E7;
                border: black;
                z-index: 1;
            } 

            .search-bar-parent {
                pointer-events: none;
            }

            .search-bar-png2 {
                width: 1507px;
                top:0px;
                padding-bottom: 158px;
            }

            .oea-title {

            }

            .oea-text {
                font-family: Montserrat;
                font-size: 38px;
                bottom: 4px;
                position: absolute;
                left: 523px;
            }

            .oea-content {
                font-family: Montserrat;
                font-size: 38px;
                bottom: 4px;
                position: absolute;
                left: 523px;
                display: none
            }


            .back-button-svg {
                height: 66px;
                width: 66px;
                position: absolute;
                top: 9px;
                left:17px;
            }
            .forward-button-svg {
                height: 66px;
                width: 66px;
                position: absolute;
                top: 9px;
                left:103px;
            }


            `}</style>







        </div>
    );
  }
}

  export default Dock;



